import React from "react";
import "./uperheader.css";

import Button from '@mui/material/Button';


const UpHeader = () => {
    return (
        <>

            <Button variant="contained" disabled>
                Disabled
            </Button>
            <i class="bi bi-twitter"></i>

        </>
    )
}
export default UpHeader
